import React,{useEffect, useState} from 'react';
import './App.css';
import Card from './components/card/card';
import getCardData from './services/getData';



function App() {
  const [data, setData] = useState();

  const loadData = async () => {
    const data = await getCardData();
    setData(data);
  }

  useEffect(() => {
    loadData();
  }, []);

  console.log(data)
  return (
    <div className="App">
      
    </div>
  );
}

export default App;
